requirement.text:
cil_u8Actv_Client will be: 
1 fi requested profile executed was on PRESAFE;
2 if ORC is requested
3 if is API;
4 if BSR algo is executed
6 , other requests (diagnostic/startup)

For the folklowing autotest the status of error shall be checked in order to deskill the error and decide autotest result,: 
CIL_Autotest_Presafe_CheckTimeoutError;
CIL_Autotest_Buckle_CheckTimeoutError;
CIL_Autotest_CheckTimeoutError_BelthandoverL;
CIL_Autotest_CheckTimeoutError_BelthandoverR;
CIL_Autotest_CheckTimeoutError_Powertrain

For the following autotests, a notification counter shall be taken into account , in order to decide the result of the autotest.
CIL_Autotest_Presafe_CheckTimeoutError;
->variable: cil_u8CounterNotifPresf
CIL_Autotest_Buckle_CheckTimeoutError;
-> variable: cil_u8CounterNotifBckl
CIL_Autotest_CheckTimeoutError_BelthandoverL;
-> variable: cil_u8CounterNotifBltL
CIL_Autotest_CheckTimeoutError_BelthandoverR;
-> variable: cil_u8CounterNotifBltR
CIL_Autotest_CheckTimeoutError_Powertrain
-> variable: cil_u8CounterNotifPwt

For the following autotests, in order to deskill the error, a deskill counter shall be increment, but only if the corresponding error is qualified:
CIL_Autotest_Presafe_CheckTimeoutError;
-> variable: cil_u8DeskillCounterPresf
CIL_Autotest_Buckle_CheckTimeoutError;
-> variable: cil_u8DeskillCounterBckl
CIL_Autotest_CheckTimeoutError_BelthandoverL;
-> variable: cil_u8DeskillCounterBltL
CIL_Autotest_CheckTimeoutError_BelthandoverR;
-> variable: cil_u8DeskillCounterBltR
CIL_Autotest_CheckTimeoutError_Powertrain
->variable: cil_u8DeskillCounterPwt
